import "./App.scss";
import React from "react";
import Children from "./components/Children/children";
import Toggle from "./components/states/toggle";
function App() {
  return (
    <div>
      <h1>nguyen phu an</h1>
      <Children name="an d bo"></Children>
      <Toggle></Toggle>
    </div>
  );
}

export default App;
